LIBRARY IEEE;
USE IEEE.std_logic_1164.ALL;
USE IEEE.std_logic_signed.ALL;
USE IEEE.numeric_std.ALL;

LIBRARY work;
USE work.ALL;
USE work.Components.ALL;

entity softmax_core1 is
    generic
    (
        PIPELINE_STEPS             : natural := 3
    );
    port
    (
        clk   : in std_logic;
        rst   : in std_logic;

        xi    : in std_logic_vector(8-1 downto 0); --	ufix(3, -5)
        sel_config: in    std_logic_vector(bits(32000-1)-1 downto 0);
    
        yo_1  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_2  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_3  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_4  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_5  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_6  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_7  : out std_logic_vector(16-1 downto 0);  --	sfix(3, -13)
        yo_8  : out std_logic_vector(16-1 downto 0) --	sfix(3, -13)
    );
end softmax_core1;

architecture structural of softmax_core1 is

    -- like this: signal x_wc3c1_signal :   std_logic_vector(14 downto 0);
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(16-1 downto 0); --	sfix(3, -13)
    signal  x__signal : std_logic_vector(14-1 downto 0); --	sfix(1, -13)

    signal zeros 	   : std_logic_vector(1 downto 0 );
    --signal x__signal : std_logic_vector(1 downto 0 );
    --signal xi_reg      : std_logic_vector((XI_WIDTH-1) downto 0);

    signal sel_reg     : std_logic_vector(bits(32000-1)-1 downto 0);


begin
    zeros <= (others => '0');

    sel_reg <= sel_config;

    --input_reg   : entity work.reg generic map(DATA_WIDTH => XI_WIDTH) port map(clk, rst, xi, xi_reg);

    rmcm_block  : entity work.softmax_core1_rmcm
        generic map(PIPELINE_STEPS => PIPELINE_STEPS)
        port map
        (
            
                clk,
                sel_reg,
            
                xi,
                --like this: x_wc3c1_signal,
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal, 
                R_ => x__signal
       );

    -- like this: x_C1_TR_K1_R1_C1_Wm69 <= std_logic_vector(resize(signed(x_wc3c1_signal),(XI_WIDTH+WI_WIDTH)));
    --x__signal <= zeros; -- YES THIS IS NEEDED! DO NOT DELETE!!! FloPoCo does not generate this coefficient! So we keep it here so it is there when needed.
    yo_1 <= x__signal;
    yo_2 <= x__signal;
    yo_3 <= x__signal;
    yo_4 <= x__signal;
    yo_5 <= x__signal;
    yo_6 <= x__signal;
    yo_7 <= x__signal;
    yo_8 <= x__signal;



end structural;